import React from 'react';
import './errorMessage.css';

import error from 'error.jpeg'

const ErrorMessage = () => {
  return (
    <>
      <img src={error} alt="error"/>
      <span>Something goes wrong</span>
    </>
  )
};

export default ErrorMessage;
